(22, '2018-04-23 14:10:42', '2018-04-23 14:10:42', NULL, 'mo ta them cho vai loi ve chung toi', '', 'Công ty Cổ phần Công nghệ Mectronic được thành lập bởi đội ngũ kỹ sư giàu kinh nghiệm và tâm huyết. Với sự dẫn dắt, chèo lái của "vị thuyền trưởng" Mến Võ, công ty từ chỗ chưa ai biết đến đã vươn lên dẫn đầu thị trường như hiện nay.', 'Mectronic Technology Corporation was founded by a team of experienced and dedicated engineers. With the lead, steering of the "captain" Men Vo, the company from the unknown has risen to lead the market today.', 'Mectronic Technology Corporationは、経験豊富で専任のエンジニアチームによって設立されました。 "キャプテン"の男性Voの指揮、ステアリングで、未知の会社は今日市場をリードしています。', 'Mectronic Technology Corporation由經驗豐富的專業工程師組成。 在領導下，來自未知公司的“隊長”Men Vo的指導已經上升到今天領先市場。', 0),
