(37, '2018-04-23 23:14:59', '2018-04-24 02:27:04', NULL, 'mo ta vi tri nu tro ly giam doc', '', 'Để đáp ứng nhu cầu ngày càng mở rộng và phát triển của công ty. Hiện chúng tôi đang cần tuyển một bạn trợ lý nhanh nhẹn, hoạt bát và tinh tế với những tố chất đặt biệt, quan trọng là phù hợp với văn hóa công ty.', 'To meet the ever-expanding needs and development of the company. We are currently looking for a fast, energetic, and sophisticated assistant with a special personality that is relevant to the company culture.', '絶えず拡大するニーズと会社の発展に対応する。 私たちは現在、会社の文化に関連する特別な人格を持つ、素早く元気で洗練されたアシスタントを探しています。', '\n為了滿足公司不斷擴大的需求和發展。 我們目前正在尋找一位快速，精力充沛，經驗豐富的助理，具有與公司文化相關的特殊個性。', 0),
